void cursor_to_right(unsigned short *pfbdata, int xres) {

	int x1 = ((pos - 1) % 10) * 24 + ((pos - 1) % 10) * 4;
	int y1 = ((pos - 1) / 10) * 24 + ((pos - 1) / 10) * 4;

	pixel = makepixel(0, 0, 0);
	for (y = y1; y < y1 + 24; y++) {

		offset = y * xres + x1 - 2;
		*(pfbdata + offset) = pixel;
		offset = y * xres + x1 - 3;
		*(pfbdata + offset) = pixel;
	}
	if (pos == 80) {
		x1 = x1 + 28;

		pixel = makepixel(255, 255, 255);

		for (y = y1; y < y1 + 24; y++) {
			offset = y * xres + x1 - 2;
			*(pfbdata + offset) = pixel;
			offset = y * xres + x1 - 3;
			*(pfbdata + offset) = pixel;
		}

	}
	else {
		x1 = (pos % 10) * 24 + (pos % 10) * 4;
		y1 = (pos / 10) * 24 + (pos / 10) * 4;

		pixel = makepixel(255, 255, 255);

		for (y = y1; y < y1 + 24; y++) {
			offset = y * xres + x1 - 2;
			*(pfbdata + offset) = pixel;
			offset = y * xres + x1 - 3;
			*(pfbdata + offset) = pixel;
		}
	}

}


void cursor_to_left(unsigned short *pfbdata, int xres) {
	int x1;
	int y1;
	if (pos == 79) {
		x1 = (79 % 10) * 24 + (79 % 10) * 4;
		y1 = (79 / 10) * 24 + (79 / 10) * 4;
		x1 = x1 + 28;

	}
	else {
		x1 = ((pos + 1) % 10) * 24 + ((pos + 1) % 10) * 4;
		y1 = ((pos + 1) / 10) * 24 + ((pos + 1) / 10) * 4;
	}
	pixel = makepixel(0, 0, 0);
	for (y = y1; y < y1 + 24; y++) {

		offset = y * xres + x1 - 2;
		*(pfbdata + offset) = pixel;
		offset = y * xres + x1 - 3;
		*(pfbdata + offset) = pixel;
	}
	x1 = (pos % 10) * 24 + (pos % 10) * 4;
	y1 = (pos / 10) * 24 + (pos / 10) * 4;

	pixel = makepixel(255, 255, 255);

	for (y = y1; y < y1 + 24; y++) {

		offset = y * xres + x1 - 2;
		*(pfbdata + offset) = pixel;
		offset = y * xres + x1 - 3;
		*(pfbdata + offset) = pixel;
	}

}


int main()

{
	wiringPiSetup();
	int fbfd;
	int ret;


	struct fb_var_screeninfo fbvar;
	fbfd = open(FBDEVFILE, O_RDWR);




	pinMode(PORT_0, INPUT);
	pinMode(PORT_1, INPUT);

	pinMode(PORT_2, INPUT);
	pinMode(PORT_3, INPUT);
	pinMode(PORT_4, INPUT);
	pinMode(PORT_5, INPUT);
	pinMode(PORT_6, INPUT);
	pinMode(PORT_7, INPUT);
	pinMode(PORT_8, INPUT);
	pullUpDnControl(PORT_6, PUD_UP);
	pinMode(PORT_BUTTON1, INPUT);
	pullUpDnControl(PORT_BUTTON1, PUD_UP);
	pinMode(PORT_BUTTON2, INPUT);
	pullUpDnControl(PORT_BUTTON2, PUD_UP);
	pinMode(PORT_BUTTON3, INPUT);
	pullUpDnControl(PORT_BUTTON3, PUD_UP);

	if (fbfd < 0)
	{
		perror("fbdev open");
		exit(1);
	}

	ret = ioctl(fbfd, FBIOGET_VSCREENINFO, &fbvar);
	if (ret < 0)
	{
		perror("fbdev ioctl");
		exit(1);
	}

	if (fbvar.bits_per_pixel != 16)
	{
		fprintf(stderr, "bpp is not 16\n");
		exit(1);
	}
	unsigned short * pfbdata2;
	pfbdata2 = (unsigned short *)mmap(0, fbvar.xres * fbvar.yres * 16 / 8, PROT_READ | PROT_WRITE, MAP_SHARED, fbfd, 0);


	if ((unsigned)pfbdata2 == (unsigned)-1)
	{
		perror("fbdev mmap");
		exit(1);
	}

	unsigned short * pfbdata = pfbdata2;
	int xres = fbvar.xres;
	for (y = 0; y < 240; y++) {
		for (x = 0; x < 320; x++) {
			offset = y * fbvar.xres + x;
			pixel = makepixel(0, 0, 0);
			*(pfbdata + offset) = pixel;
		}
	}


	offset = 10 * fbvar.xres + 22;
	pfbdata = pfbdata + offset;

	int x1 = (pos % 10) * 24 + (pos % 10) * 4;
	int y1 = (pos / 10) * 24 + (pos / 10) * 4;

	pixel = makepixel(255, 255, 255);
	for (y = y1; y < y1 + 24; y++) {
		offset = y * fbvar.xres + x1 - 2;
		*(pfbdata + offset) = pixel;
		offset = y * fbvar.xres + x1 - 3;
		*(pfbdata + offset) = pixel;
	}


	int i;
	int tmpf = -1;
	int index = 0;
	int size = 0;
	int x3;
	int y3;
	int i2;
	while (1) {
		int f = 0;

		while (1) {
			delay(1);
			if (f == 1) {
				break;
			}
			if (pos == 80) {
				if (!digitalRead(PORT_BUTTON1)) {
					f = 1;
				}
			}
			else if (size == 80) {
				if (!digitalRead(PORT_BUTTON1) || !digitalRead(PORT_BUTTON2) || !digitalRead(PORT_BUTTON3)) {
					f = 1;
				}
			}
			else if (pos == 0 || size == 0) {
				if (!digitalRead(PORT_0) || !digitalRead(PORT_1) || !digitalRead(PORT_2) || !digitalRead(PORT_3) || !digitalRead(PORT_4) || !digitalRead(PORT_5) || !digitalRead(PORT_6) || !digitalRead(PORT_7) || !digitalRead(PORT_8) || !digitalRead(PORT_BUTTON3) || !digitalRead(PORT_BUTTON2) ) {
					f = 1;
				}
			}


			else if (!digitalRead(PORT_0) || !digitalRead(PORT_1) || !digitalRead(PORT_2) || !digitalRead(PORT_3) || !digitalRead(PORT_4) || !digitalRead(PORT_5) || !digitalRead(PORT_6) || !digitalRead(PORT_7) || !digitalRead(PORT_8) || !digitalRead(PORT_BUTTON1) || !digitalRead(PORT_BUTTON2) || !digitalRead(PORT_BUTTON3)) {
				f = 1;
			}
		}
		int port[] = { PORT_0, PORT_1, PORT_2, PORT_3, PORT_4, PORT_5, PORT_6, PORT_7, PORT_8 };
		for (i = 0; i<sizeof(port) / sizeof(*port); i++) {
			if (!digitalRead(port[i])) {
				
				if (tmpf == i) {
					pos--;
					size--;
					cursor_to_left(pfbdata, xres);
					index = (index + 1) % 3;
				}
				else {
					index = 0;

					for (i2 = size - 1; i2 >= pos; i2--) {
						x1 = (i2 % 10) * 24 + (i2 % 10) * 4;
						y1 = (i2 / 10) * 24 + (i2 / 10) * 4;
						x3 = ((i2 + 1) % 10) * 24 + ((i2 + 1) % 10) * 4;
						y3 = ((i2 + 1) / 10) * 24 + ((i2 + 1) / 10) * 4;
						for (y = y1; y < y1 + 24; y++) {
							offset = y * fbvar.xres + x1;
							int offset2 = y3*fbvar.xres + x3;
							memmove(pfbdata + offset2, pfbdata + offset, sizeof(*pfbdata) * 24);
							y3 = y3 + 1;
						}
					}
				}
				tmpf = i;
				int i2;
				int x1;
				int y1;

				x1 = (pos % 10) * 24 + (pos % 10) * 4;
				y1 = (pos / 10) * 24 + (pos / 10) * 4;

				for (y = y1; y<y1 + 24; y++) {
					for (x = x1; x<x1 + 24; x++) {
						offset = y * fbvar.xres + x;
						//	pixel = makepixel(0, 0, 0);
						//*(pfbdata + offset) = pixel;
						pixel = makepixel(english[3 * i + index][y - y1][x - x1], english[3 * i + index][y - y1][x - x1], english[3 * i + index][y - y1][x - x1]);
						*(pfbdata + offset) = pixel;
					}
				}

				pos++;
				size++;
				cursor_to_right(pfbdata, xres);
				delay(275);
			}
		}

		if (!digitalRead(PORT_BUTTON1)) {
			pos--;
			cursor_to_left(pfbdata, xres);
			tmpf = -1;
			delay(275);

		}
		if (!digitalRead(PORT_BUTTON2)) {
			for (i2 = pos; i2 < size; i2++) {
				if (i2 + 1 < 80) {
					x1 = (i2 % 10) * 24 + (i2 % 10) * 4;
					y1 = (i2 / 10) * 24 + (i2 / 10) * 4;
					x3 = ((i2 + 1) % 10) * 24 + ((i2 + 1) % 10) * 4;
					y3 = ((i2 + 1) / 10) * 24 + ((i2 + 1) / 10) * 4;
					for (y = y1; y < y1 + 24; y++) {
						offset = y * fbvar.xres + x1;
						int offset2 = y3*fbvar.xres + x3;
						memmove(pfbdata + offset, pfbdata + offset2, sizeof(*pfbdata) * 24);
						y3 = y3 + 1;
					}
				}
				else {
					x1 = (79 % 10) * 24 + (79 % 10) * 4;
					y1 = (79 / 10) * 24 + (79 / 10) * 4;
					pixel = makepixel(0, 0, 0);
					for (y = y1; y<y1 + 24; y++) {
						for (x = x1; x<x1 + 24; x++) {
							offset = y * fbvar.xres + x;
							*(pfbdata + offset) = pixel;
						}
					}
				}

			}
			if (pos < size) {
				size = size - 1;
			}

			tmpf = -1;
			delay(275);



		}
		if (!digitalRead(PORT_BUTTON3)) {
			//pos++;
			if (tmpf <12) {
				tmpf = 12; 
			}
			else {
				tmpf = 13;
			}
			if (size == pos && tmpf != 13) {
				cursor_to_right(pfbdata, xres);

			}
			else if (size == pos && tmpf == 13) {
				cursor_to_right(pfbdata, xres);
				pos++;
				size++;
				cursor_to_right(pfbdata, xres);
				tmpf = -1;

			}
			else if (pos < size) {
				pos++;
				cursor_to_right(pfbdata, xres);
				tmpf = -1;
			}


			delay(275);
		}



	}


	munmap(pfbdata2, fbvar.xres*fbvar.yres * 16 / 8);
	close(fbfd);
	return 0;




}

